import styled from 'styled-components';

export const Hamburger = styled.div`
  img {
    width: 2rem;
    height: 2rem;
    color: red;
    /* color: ${(props) => props.theme.themeStyle.backgroundColor}; */
  }
  @media ${(props) => props.theme.breakpoints.TABLETMIN} {
    img {
      display: none;
    }
  }
`;
